import React, { useState } from 'react';
import Button from './navitem';
import { FaKey } from 'react-icons/fa'; 
import { usePage } from '../PageContext';
import Modal from './Modal'; // Assurez-vous d'importer le composant Modal

const NavbarRight = () => {
  const { currentPage } = usePage();
  const [isModalOpen, setModalOpen] = useState(false);

  const openModal = () => {
    console.log('Opening modal');
    setModalOpen(true);
  };

  const closeModal = () => {
    console.log('Closing modal');
    setModalOpen(false);
  };

  return (
    <div style={{ display: 'flex', flexDirection: 'column', position: 'absolute', right: '48px', top: '48px', gap: '10px' }}>
      <Button icon={<FaKey />} label="Filters" onClick={openModal} />
      {currentPage !== 'home' && (
        <Button icon={<FaEye />} label="New Button" /> 
      )}
      <Modal isOpen={isModalOpen} onClose={closeModal} />
    </div>
  );
};

export default NavbarRight;
